import React, { useState } from 'react';
import './Sell.css';

const Sell = () => {
  const [step, setStep] = useState(1); // Step 1: User Info, Step 2: Car Info
  const [userInfo, setUserInfo] = useState({
    name: '',
    surname: '',
    email: '',
    password: '',
    phone: '',
  });
  const [carInfo, setCarInfo] = useState({
    make: '',
    model: '',
    year: '',
    kilometers: '',
    price: '',
    exteriorColor: '',
    interiorColor: '',
    engineType: '',
    horsepower: '',
    fuelType: '',
    description: '',
    images: []
  });

  const handleUserInfoChange = (e) => {
    setUserInfo({ ...userInfo, [e.target.name]: e.target.value });
  };

  const handleCarInfoChange = (e) => {
    setCarInfo({ ...carInfo, [e.target.name]: e.target.value });
  };

  const handleImageUpload = (e) => {
    setCarInfo({ ...carInfo, images: [...carInfo.images, ...e.target.files] });
  };

  const handleNextStep = () => {
    setStep(2);
  };

  const handlePreviousStep = () => {
    setStep(1);
  };

  return (
    <div className="sell-page">
      {step === 1 && (
        <div className="registration-form">
          <h2>Get Started</h2>
          <p>Enter your personal information to start selling a car.</p>
          <div className="form-group">
            <input
              type="text"
              name="name"
              value={userInfo.name}
              onChange={handleUserInfoChange}
              placeholder="Name"
              required
            />
            <input
              type="text"
              name="surname"
              value={userInfo.surname}
              onChange={handleUserInfoChange}
              placeholder="Surname"
              required
            />
          </div>
          <div className="form-group">
            <input
              type="email"
              name="email"
              value={userInfo.email}
              onChange={handleUserInfoChange}
              placeholder="Email"
              required
            />
            <input
              type="password"
              name="password"
              value={userInfo.password}
              onChange={handleUserInfoChange}
              placeholder="Password"
              required
            />
          </div>
          <div className="form-group">
            <input
              type="tel"
              name="phone"
              value={userInfo.phone}
              onChange={handleUserInfoChange}
              placeholder="Phone Number"
              required
            />
          </div>
          <button className="next-btn" onClick={handleNextStep}>
            Next: Car Details
          </button>
        </div>
      )}

      {step === 2 && (
        <div className="car-details-form">
          <h2>Car Details</h2>
          <div className="form-group">
            <input
              type="text"
              name="make"
              value={carInfo.make}
              onChange={handleCarInfoChange}
              placeholder="Car Make"
              required
            />
            <input
              type="text"
              name="model"
              value={carInfo.model}
              onChange={handleCarInfoChange}
              placeholder="Car Model"
              required
            />
          </div>
          <div className="form-group">
            <input
              type="number"
              name="year"
              value={carInfo.year}
              onChange={handleCarInfoChange}
              placeholder="Year"
              required
            />
            <input
              type="number"
              name="kilometers"
              value={carInfo.kilometers}
              onChange={handleCarInfoChange}
              placeholder="Kilometers"
              required
            />
          </div>
          <div className="form-group">
            <input
              type="number"
              name="price"
              value={carInfo.price}
              onChange={handleCarInfoChange}
              placeholder="Price"
              required
            />
          </div>
          <div className="form-group">
            <input
              type="text"
              name="exteriorColor"
              value={carInfo.exteriorColor}
              onChange={handleCarInfoChange}
              placeholder="Exterior Color"
            />
            <input
              type="text"
              name="interiorColor"
              value={carInfo.interiorColor}
              onChange={handleCarInfoChange}
              placeholder="Interior Color"
            />
          </div>
          <div className="form-group">
            <input
              type="text"
              name="engineType"
              value={carInfo.engineType}
              onChange={handleCarInfoChange}
              placeholder="Engine Type (e.g., V6, Electric)"
            />
            <input
              type="number"
              name="horsepower"
              value={carInfo.horsepower}
              onChange={handleCarInfoChange}
              placeholder="Horsepower"
            />
          </div>
          <div className="form-group">
            <label>Fuel Type:</label>
            <select
              name="fuelType"
              value={carInfo.fuelType}
              onChange={handleCarInfoChange}
              required
            >
              <option value="">Select Fuel Type</option>
              <option value="Petrol">Petrol</option>
              <option value="Diesel">Diesel</option>
              <option value="Electric">Electric</option>
              <option value="Hybrid">Hybrid</option>
            </select>
          </div>
          <textarea
            name="description"
            value={carInfo.description}
            onChange={handleCarInfoChange}
            placeholder="Describe your car..."
            required
          />
          <div className="form-group">
            <label>Upload Car Images:</label>
            <input type="file" multiple onChange={handleImageUpload} />
          </div>
          <div className="images-preview">
            {carInfo.images.length > 0 ? (
              carInfo.images.map((img, idx) => (
                <img key={idx} src={URL.createObjectURL(img)} alt="Car" />
              ))
            ) : (
              <p>No images uploaded</p>
            )}
          </div>
          <div className="form-actions">
            <button className="back-btn" onClick={handlePreviousStep}>Back</button>
            <button className="submit-btn">Submit Listing</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Sell;
